The “Eeny Meeny Miney Mo Foundation” is a not for profit, Health Services and Advancing Education Charity (ABN: 82 603 772 514) which:

•	Provides resources to the community about parental alienation*.
•	Provides support and educates the community about parental alienation.
•	Collaborates with other community organisations in order to achieve the above. 

WEBSITE:	www.emmm.org.au
Facebook:	www.facebook.com/EMMMFoundation
Facebook:	www.facebook.com/paaustralianews
RESEARCH:	 www.parentalalienation.org.au

We achieve this through activities and advocacy which:
•	Provide information and educate about Parental Alienation and it’s impact;
•	Raise public awareness and understanding of the nature, extent and life-long impact of the trauma and psychological child abuse that so often accompanies family separation;
•	Have Parental Alienation formally recognised as Psychological Child Abuse and as Family Violence in Australia;
•	Provide information and support to parents and children experiencing Parental Alienation, as well as to other services that may provide such support;
•	Commission and support research to enhance knowledge of the causes and consequences of Parental Alienation;
•	Forge a greater alliance between organisations working nationally and internationally to the same ends;
•	Promote partnerships across health and other sectors to enhance responsiveness and support to all Australians who may experience or be at risk of experiencing Parental Alienation.

* “PARENTAL ALIENATION” is a process involving one parent (alienating parent) who negatively influences a child’s perception of the other parent (targeted parent). This results in the alienating parent damaging the once positive relationship between the child and the targeted parent. 
The “alienating parent” can also be a grandparent, a stepparent & even a non-family member. Parental alienation can occur even if the relationship between the targeted child and targeted parent was once a very positive one.

